import React from "react";

const RightSidebarFirst = () => {
  return (
    <div className="w-1/4 p-4">
      <div className="flex flex-col items-start gap-2">
        <p className="text-lg font-bold" style={{ color: "#1b475d" }}>
          UniWalls! a giriş yap
        </p>
        <p className="text-sm" style={{ color: "#90beab" }}>kampüs</p>

        <p className="text-sm" style={{ color: "#1b475d" }}>hayatını</p>
        <p className="text-sm" style={{ color: "#1b475d" }}>dijitalde</p>
        <p className="text-sm" style={{ color: "#1b475d" }}>yaşa</p>
      </div>
    </div>
  );
};

export default RightSidebarFirst;
